function signup_validation() {
    $("#user_signup").unbind("submit");
    var t = {
        target: "",
        beforeSubmit: null,
        success: signup_validation_Response,
        url: JS_SERVER_PATHROOT + "signupcontroller/UserRegister",
    };
    $("#user_signup").submit(function () {
        return $(this).ajaxSubmit(t), !1;
    });
}
function signup_validation_Response(t, e) {
    (myarray = new Array()),
        (myarray = t.split("-SEPARATOR-")),
        -1 != t.search("done")
            ? ($("html, body").animate({ scrollTop: 0 }, "slow"),
                $("#user_signup").each(function () {
                    this.reset();
                }),
                $("#error_div").hide(),
                setTimeout("gotolink('" + myarray[1] + "')", 2e3))
            : ($("html, body").animate({ scrollTop: 80 }, "slow"),
                $("#error_div").html(t),
                $("#error_div").show(),
                $("#success_div").hide());
}
function validate_signin() {
    $("#user_signin").unbind("submit");
    var t = {
        target: "",
        beforeSubmit: null,
        success: validate_signin_Response,
        url: JS_SERVER_PATHROOT + "signincontroller/UserLogin/",
    };
    $("#user_signin").submit(function () {
        return $(this).ajaxSubmit(t), !1;
    });
}
function validate_signin_Response(t, e) {
    var i = new Array();
    if (((i = t.split("-SEPARATOR-")), "done" == i[0]))
        $("#user_signin").each(function () {
            this.reset();
        }),
            window.location.reload();
    else {
        var s = new Array();
        s = t.split("<p>");
        for (var o = "", n = 1; n < s.length; n++)
            o += s[n].replace("</p>", "");
        "" == o ? alert(t) : alert(o);
    }
}
